import sympy
def lcs(n):
    a=1
    while n>1:
        if n%2==0:
            n=n//2
        else:
            n=(3*n)+1
        a=a+1
    return(a)
m=2
while m>0:
    n=sympy.nextprime(m)
    if lcs(m)==lcs(n):
        print(m,)
    m=n
